"use strict";(self.webpackChunkjava_note_vuepress2=self.webpackChunkjava_note_vuepress2||[]).push([[8790],{68004:(a,n,e)=>{e.r(n),e.d(n,{data:()=>s});const s={key:"v-b2b8824e",path:"/maven/004-%E9%AA%A8%E6%9E%B6%E5%92%8Cpackaging.html",title:"骨架是浮云，packaging 是关键",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"maven/004-骨架和packaging.md",git:{updatedTime:1629711344e3,contributors:[{name:"hemiao",email:"hemiao3000@126.com",commits:1}]}}},52645:(a,n,e)=>{e.r(n),e.d(n,{default:()=>r});const s=(0,e(66252).uE)('<h1 id="骨架是浮云-packaging-是关键" tabindex="-1"><a class="header-anchor" href="#骨架是浮云-packaging-是关键" aria-hidden="true">#</a> 骨架是浮云，packaging 是关键</h1><p>骨架<small>（archetype）</small>会影响你的 maven 项目的 <em>pom.xml</em> 配置文件的 <strong>&lt;packaging&gt;...&lt;/packaging&gt;</strong> 元素的值，这个值决定了：</p><ol><li><p>你的项目是 java 项目，还是 java web 项目；</p></li><li><p>你的项目最终是打成 jar 包，还是打成 war 包；</p></li><li><p>你的项目的目录结构。</p></li></ol><p>骨架决定了你的项目的类型<small>（和目录结构）</small>只是表像！真正起作用的是 <strong>&lt;packaging&gt;</strong> 元素的值。</p><ul><li><p><strong>maven-archetype-quickstart</strong> 骨架会导致 <strong>&lt;packaging&gt;jar&lt;/packaging&gt;</strong> ，表示项目是一个 Java 项目，最终要打成 <em>jar</em> 包。</p><p>其结构的完整形式应该、必须、一定如下：</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>项目\n│── pom.xml\n└── src\n    ├── main\n    │   │── java\n    │   └── resources\n    └── test\n        │── java\n        └── resources\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><strong>jar</strong> 也是也是 <em>&lt;packaging&gt;</em> 的默认值，缺省 <em>&lt;packaging&gt;</em> 时等价于 <em>&lt;packaging&gt;jar&lt;/packaging&gt;</em> 。</p></li><li><p><strong>maven-archetype-webapp</strong> 意味着 <strong>&lt;packaging&gt;war&lt;/packaging&gt;</strong> ，表示项目是一个 Java Web 项目，最终要打成 <em>war</em> 包。</p><p>其目录结构应该、必须、一定如下：</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>项目\n│── pom.xml\n└── src\n    ├── main\n    │   │── java\n    │   │── resources\n    │   └── webapp\n    └── test\n        │── java\n        └── resources\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br></div></div></li></ul>',5),r={render:function(a,n){return s}}}}]);